function HideShowExerciseButton(n){n===0?$("#btnGenerateExercise").addClass("d-none"):$("#btnGenerateExercise").removeClass("d-none")}function UpdateExerciseCount(n){const t={type:"POST",url:"Equipment/UpdateExerciseCount",data:{muscleGroupIds:muscleGroupIds,equipmentIds:n}};CallController(t,function(n){HideShowExerciseButton(parseInt(n));$("#eCount").html(n)})}function UpdateEquipmentIdsSession(n){const t={type:"POST",url:"Equipment/UpdateEquipmentIdsSession",data:{equipmentIds:n}};CallController(t,function(){})}function GetEquipmentFromUserEquipmentSet(n){const t={type:"POST",url:"Equipment/GetEquipmentFromUserEquipmentSet",data:{equipmentSetId:n}};CallController(t,function(n){const t=n;$("#select2_equipment").val(t);$("#select2_equipment").trigger("change");UpdateExerciseCount($("#select2_equipment").val())})}$(document).ready(function(){for(let n=0;n<muscleGroupIds.length;n++)$("#formEquipment").append(`<input type='hidden' name=muscleGroupIds[] value=${muscleGroupIds[n]} />`);$("#select2_equipment").select2();$("#select2_equipment").on({"select2:select":function(){UpdateExerciseCount($(this).val());UpdateEquipmentIdsSession($(this).val())},"select2:unselect":function(){UpdateExerciseCount($(this).val());UpdateEquipmentIdsSession($(this).val())}});$("#btnClearSelection").on("click",function(){$("#select2_equipment").val(null).trigger("change");$("#select2_equipment option").prop("disabled",!1);$("#btnContinue").addClass("d-none");UpdateEquipmentIdsSession($("#select2_equipment").val());UpdateExerciseCount($("#select2_equipment").val())});$("#btnSelectAll").on("click",function(){$("#select2_equipment > option").prop("selected","selected");$("#select2_equipment").trigger("change");UpdateEquipmentIdsSession($("#select2_equipment").val());UpdateExerciseCount($("#select2_equipment").val())});$("#select_equipment_sets").on({change:function(){const n=parseInt($(this).val());n!==-1&&GetEquipmentFromUserEquipmentSet(n)}})});